import React from 'react'
import Link from 'next/link'

import { AppLink } from './AppLink'


export const AppRouterLink = ({ href, children, ...rest }) => {
  console.log(href, rest, children)
  return (
    <Link href={ href } { ...rest }>
      <AppLink>
        { children }
      </AppLink>
    </Link>
  )
}
